An ID of 0 corresponds to the backup framebuffer system object - a framebuffer created by the bootloader or kernel that can be used if there is not a more specialized graphics driver available (e.g. on x86_64, this uses the UEFI Graphics Output Protocol to create a basic linear framebuffer). The object is a MemoryObject that is meant to be mapped into the userspace driver and directly written to as video memory. A userspace address should be passed as b, which is used to pass information about the framebuffer back to userspace from the kernel. The memory must be user-accessible and writable. The format of the written structure is: #[repr(C)]
struct FramebufferInfo { /// The address of the start of the framebuffer address: usize, width: u16, height: u16, stride: u16, /// 0 = RGB32 /// 1 = BGR32 pixel_format: u8,
}
